import React, {useState, useEffect} from 'react'
import './App.css';


function App() {

    const [data, setData] = useState([{}])

    useEffect( () => {
        fetch("/users").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])
  return(
      <div>
                {(typeof data.user_list === 'undefined')} ? (
                        <p>Loading...</p>
                  )  :  (

                      data.user_list.map((user, i) => (
                        <p key = {i}> {user}</p>
                    ))
                  )}
      </div>
  )
}

export default App
